import React, { useState, useEffect } from 'react';
import { BarChart3, MessageSquare, Brain, Users, TrendingUp } from 'lucide-react';

interface DashboardStats {
  totalChats: number;
  totalKnowledge: number;
  activeUsers: number;
  avgResponseTime: number;
}

const Dashboard: React.FC = () => {
  const [stats, setStats] = useState<DashboardStats>({
    totalChats: 0,
    totalKnowledge: 0,
    activeUsers: 1,
    avgResponseTime: 1.2
  });

  useEffect(() => {
    // Simulate fetching dashboard stats
    const fetchStats = () => {
      // In a real app, this would fetch from API
      setStats({
        totalChats: Math.floor(Math.random() * 100) + 50,
        totalKnowledge: Math.floor(Math.random() * 20) + 10,
        activeUsers: Math.floor(Math.random() * 5) + 1,
        avgResponseTime: Math.random() * 2 + 0.5
      });
    };

    fetchStats();
    const interval = setInterval(fetchStats, 30000); // Update every 30 seconds

    return () => clearInterval(interval);
  }, []);

  const StatCard: React.FC<{
    title: string;
    value: string | number;
    icon: React.ReactNode;
    color: string;
  }> = ({ title, value, icon, color }) => (
    <div className="bg-white rounded-lg shadow-md p-6 border-l-4" style={{ borderLeftColor: color }}>
      <div className="flex items-center justify-between">
        <div>
          <p className="text-gray-600 text-sm font-medium">{title}</p>
          <p className="text-2xl font-bold text-gray-900">{value}</p>
        </div>
        <div className={`p-3 rounded-full`} style={{ backgroundColor: `${color}20` }}>
          <div style={{ color }}>{icon}</div>
        </div>
      </div>
    </div>
  );

  return (
    <div className="h-full bg-gray-50 p-6">
      {/* Header */}
      <div className="mb-8">
        <h1 className="text-3xl font-bold text-gray-900">Dashboard</h1>
        <p className="text-gray-600 mt-2">Overview of your chatbot performance and analytics</p>
      </div>

      {/* Stats Grid */}
      <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-4 gap-6 mb-8">
        <StatCard
          title="Total Conversations"
          value={stats.totalChats}
          icon={<MessageSquare className="w-6 h-6" />}
          color="#3B82F6"
        />
        <StatCard
          title="Knowledge Items"
          value={stats.totalKnowledge}
          icon={<Brain className="w-6 h-6" />}
          color="#10B981"
        />
        <StatCard
          title="Active Users"
          value={stats.activeUsers}
          icon={<Users className="w-6 h-6" />}
          color="#F59E0B"
        />
        <StatCard
          title="Avg Response Time"
          value={`${stats.avgResponseTime.toFixed(1)}s`}
          icon={<TrendingUp className="w-6 h-6" />}
          color="#EF4444"
        />
      </div>

      {/* Charts Section */}
      <div className="grid grid-cols-1 lg:grid-cols-2 gap-6">
        {/* Chat Activity Chart */}
        <div className="bg-white rounded-lg shadow-md p-6">
          <div className="flex items-center mb-4">
            <BarChart3 className="w-5 h-5 text-primary-500 mr-2" />
            <h3 className="text-lg font-semibold text-gray-900">Chat Activity</h3>
          </div>
          <div className="h-64 flex items-center justify-center bg-gray-50 rounded-lg">
            <div className="text-center">
              <BarChart3 className="w-12 h-12 text-gray-400 mx-auto mb-2" />
              <p className="text-gray-500">Chart visualization would go here</p>
              <p className="text-sm text-gray-400">Integration with charting library needed</p>
            </div>
          </div>
        </div>

        {/* Recent Activity */}
        <div className="bg-white rounded-lg shadow-md p-6">
          <h3 className="text-lg font-semibold text-gray-900 mb-4">Recent Activity</h3>
          <div className="space-y-4">
            {[
              { action: 'New conversation started', time: '2 minutes ago', type: 'chat' },
              { action: 'Knowledge item added', time: '15 minutes ago', type: 'knowledge' },
              { action: 'User asked about pricing', time: '1 hour ago', type: 'chat' },
              { action: 'System health check passed', time: '2 hours ago', type: 'system' }
            ].map((activity, index) => (
              <div key={index} className="flex items-center space-x-3 p-3 bg-gray-50 rounded-lg">
                <div className={`w-2 h-2 rounded-full ${
                  activity.type === 'chat' ? 'bg-blue-500' :
                  activity.type === 'knowledge' ? 'bg-green-500' :
                  'bg-gray-500'
                }`}></div>
                <div className="flex-1">
                  <p className="text-sm font-medium text-gray-900">{activity.action}</p>
                  <p className="text-xs text-gray-500">{activity.time}</p>
                </div>
              </div>
            ))}
          </div>
        </div>
      </div>

      {/* Quick Actions */}
      <div className="mt-8">
        <h3 className="text-lg font-semibold text-gray-900 mb-4">Quick Actions</h3>
        <div className="grid grid-cols-1 md:grid-cols-3 gap-4">
          <button className="bg-primary-500 text-white p-4 rounded-lg hover:bg-primary-600 transition-colors">
            <MessageSquare className="w-6 h-6 mb-2" />
            <span className="block font-medium">Start New Chat</span>
          </button>
          <button className="bg-green-500 text-white p-4 rounded-lg hover:bg-green-600 transition-colors">
            <Brain className="w-6 h-6 mb-2" />
            <span className="block font-medium">Add Knowledge</span>
          </button>
          <button className="bg-purple-500 text-white p-4 rounded-lg hover:bg-purple-600 transition-colors">
            <BarChart3 className="w-6 h-6 mb-2" />
            <span className="block font-medium">View Analytics</span>
          </button>
        </div>
      </div>
    </div>
  );
};

export default Dashboard;
